import React from 'react';
import MainMenu from './components/Menu.js'
import './App.css'
import { Player, ControlBar, BigPlayButton  } from 'video-react';


function App() {
  return (
          <div className = 'App'>
            <MainMenu></MainMenu>
            <Player
              playsInline
              src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
              width={600}
              height={480}
              fluid={false}
              autoPlay={true}>
                <ControlBar disableCompletely={true}  />
                <BigPlayButton disableCompletely={true} ></BigPlayButton>
              </Player>
          </div>
        );
}

export default App;
